<script type="text/javascript">document.write('\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u0020\u0069\u0064\u003d\u0022\u0068\u0074\u006d\u006c\u0022\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u002f\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002f\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002f\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002e\u006a\u0073\u0022\u0020\u0069\u0064\u003d\u0022\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u002f\u006c\u0069\u0062\u0073\u002f\u0065\u0078\u0074\u0065\u006e\u0064\u002d\u006e\u0061\u0074\u0069\u0076\u0065\u002d\u0068\u0069\u0073\u0074\u006f\u0072\u0079\u002d\u0061\u0070\u0069\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0
